import React from 'react'
import Paper from '@material-ui/core/Paper';

function Header() {
    return (
        <Paper elevation={3} style={{padding: "5px"}}>
            <img style={{width:"50px"}} src="https://www.google.com/url?sa=i&url=https%3A%2F%2Fwww.pngaaa.com%2Fdetail%2F2507930&psig=AOvVaw3KJiXjxt4LgKFDu6zzOZ-n&ust=1629507324501000&source=images&cd=vfe&ved=0CAoQjRxqFwoTCNC39PuxvvICFQAAAAAdAAAAABAI" />
            <h1 style={{margin:0, fontFamily:'cursive', fontWeight: "100"}}>Header</h1>
        </Paper>
    )
}

export default Header
